import React from "react";

function ProviderDashboard() {
  const demoRequests = [
    { id: 1, location: "Trichy Bypass", problem: "Engine failure" },
    { id: 2, location: "Srirangam", problem: "Flat tyre" },
  ];

  const handleAccept = (id) => {
    alert(`Accepted request ID: ${id}`);
  };

  return (
    <div className="container mt-5">
      <h2>Service Provider Dashboard</h2>
      {demoRequests.map((req) => (
        <div className="card mb-2" key={req.id}>
          <div className="card-body">
            <h5>Location: {req.location}</h5>
            <p>Problem: {req.problem}</p>
            <button
              className="btn btn-success"
              onClick={() => handleAccept(req.id)}
            >
              Accept
            </button>
          </div>
        </div>
      ))}
    </div>
  );
}

export default ProviderDashboard;
